void setCurrentSampleNum(int soundNum, int sample){
	sounds[soundNum].currentSample = sample;
}

int getSize(int soundNum){
	return sounds[soundNum].size;
}

int* getArrayAddress(int soundNum){
	return sounds[soundNum].arrayAddress;
}

void deactivateOthers(int soundNum){
	int i;
	for(i = 0; i < soundNum; i++){
		setActive(soundNum, 0);
	}
}

int getCurrentSample(int soundNum){
	int sample;
	if(!getActive(soundNum)){
		sample = 127;
		setActive(soundNum, INACTIVE);
	}
	else{
		int currentSampleNum = getCurrentSampleNum(soundNum);
		if(currentSampleNum >= (getSize(soundNum))){
			setActive(soundNum, INACTIVE);
			sample = 127;
		}
		else {
			int* sound = getArrayAddress(soundNum);
			sample = sound[currentSampleNum];
			currentSampleNum++;
			currentSampleNum++;	// rather than use both channels, we just duplicate one channel, so skip the other.
			setCurrentSampleNum(soundNum,currentSampleNum);
		}
	}
	return sample;
}

int getTotalActive(){
	int num = 0;
	int soundNum;
	for(soundNum = 0; soundNum < SOUND_NUM; soundNum++){
		if(getActive(soundNum)){
			num++;
		}
	}
	return num;
}


u16 mixedAudioSignals() {
	u32 mixed;
	int soundNum;
	mixed = getCurrentSample(0);
	for (soundNum = 1; soundNum < SOUND_NUM; soundNum++) {
		u16 currentSample = getCurrentSample(soundNum);
		mixed = (mixed + currentSample)/1;
	}
	// Digital Audio Signal Mixing Algorithm here:

	return (u16)mixed;
}

u16 getHighPrioritySound() {
	u16 result;
	int soundNum = 0;
	u16 currentSample;
	result = 128; // baseline silence if none are active.
	for (soundNum = 0; soundNum < SOUND_NUM; soundNum++) {
		currentSample = getCurrentSample(soundNum);
		if (getActive(soundNum) == TRUE) {
			result = currentSample;	// will save the highest priority sound that is active, and advance all of them
		}
	}
	return result;
}

// Fills the FIFO until it is full
void fillFIFO(){
	u32 sample;
	u16 soundData;
//	int FIFO_FILL = 200;
//	int i;
//	for (i = 0; i < FIFO_FILL; i++) {
//		sample = getHighPrioritySound();
//		sample = sample | (sample<<16);
//		XAC97_mSetInFifoData(XPAR_AXI_AC97_0_BASEADDR, sample);
//	}
	while(!XAC97_isInFIFOFull(XPAR_AXI_AC97_0_BASEADDR)){
		soundData = mixedAudioSignals(); // Mixing all active sounds
		soundData = soundData * 2;	//boost volume
		sample = soundData | (soundData<<16); // Shifting to put in Left and Right
		XAC97_mSetInFifoData(XPAR_AXI_AC97_0_BASEADDR, sample); // Writing to the FIFO
	}
}

void increaseVol(){
	volumeAttenuation -= VOL_ADJUST;
	if(volumeAttenuation < AC97_RIGHT_VOL_ATTN_0_DB) // Right is the right 2 bits, Left is the next 4 Bits
		volumeAttenuation = AC97_RIGHT_VOL_ATTN_0_DB;
	XAC97_WriteReg(XPAR_AXI_AC97_0_BASEADDR, AC97_AuxOutVol, (volumeAttenuation) | (volumeAttenuation << 8));
}

void decreaseVol(){
	// This should be += until it caps at 0x1f1f
	volumeAttenuation += VOL_ADJUST;
	if(volumeAttenuation > AC97_RIGHT_VOL_ATTN_46_0_DB)
		volumeAttenuation = AC97_RIGHT_VOL_ATTN_46_0_DB;
	XAC97_WriteReg(XPAR_AXI_AC97_0_BASEADDR, AC97_AuxOutVol, (volumeAttenuation) | (volumeAttenuation << 8));
}

void midVol(){
	volumeAttenuation = AC97_VOL_MID & 0xFF;
	XAC97_WriteReg(XPAR_AXI_AC97_0_BASEADDR, AC97_AuxOutVol, volumeAttenuation);
}

